window.bookSummaryJSON = "<p>Civil War had raged on the Al-Shan Archipelago for the past four decades, only recently coming to an end with the enthronement of the new Emperor.</p> <p>This is not his story.</p> <p>The Blood Demon, renowned general of said civil war, was tired of all the fighting and politicking that had described the last four decades of her existence. All she really wanted to do now is to go out into the world and see the many lands from her father's stories.</p> <p>Thus she retired, and went and did exactly what she wanted.</p> <p>This is the story of what happens when you toss a (retired) war machine with somewhat lacking common sense into an unsuspecting world at peace.</p>"; 
